import React from 'react'
import Layout from '../components/layout'

const Home = () => (
  <Layout>
    <h1>React Auth</h1>
    <style jsx>{`
      li {
        margin-bottom: 0.5rem;
      }
    `}</style>
  </Layout>
)

export default Home
